import React, { useState } from "react";
import {
  AppBar,
  Button,
  Container,
  Drawer,
  IconButton,
  List,
  ListItemButton,
  ListItemText,
  Tab,
  Tabs,
  Toolbar,
  Typography,
  useMediaQuery,
  useTheme
} from "@mui/material";
import AddBusinessRoundedIcon from "@mui/icons-material/AddBusinessRounded";
import MenuIcon from "@mui/icons-material/Menu";
import { NavLink } from "react-router-dom";


const Navbar = () => {
  const [value, setValue] = useState();
  const [openDrawer, setOpenDrawer] = useState(false);
  const theme = useTheme();
  const isMatch = useMediaQuery(theme.breakpoints.down("md"));

  return (
    <React.Fragment>
      <AppBar sx={{ background: "#f5f5fd", color: "black", boxShadow: "none",height:'70px'}}>
        <Container maxWidth="xl">
          <Toolbar>
          <NavLink to='/'><AddBusinessRoundedIcon
              sx={{ transform: "scale(2)", color: "#6b3bc4" }}
            /></NavLink>
             <NavLink to='/' style={{ textDecoration: 'none' }}>
            <Typography
              sx={{
                color: "#6b3bc4",
                fontSize: "2rem",
                paddingLeft: "2%",
                textDecoration:"none",
                display: { xs: "none", md: "flex" },
              }}
            >
              Payakon
            </Typography></NavLink>
            {isMatch ? (
              <>
                <NavLink to='/' style={{ textDecoration: 'none' }}><Typography
                  sx={{ color: "#6b3bc4", fontSize: "2rem", paddingLeft: "3%",textDecoration:"none" }}
                >
                  Payakon
                </Typography></NavLink>
                <IconButton
                  sx={{ color: "black", marginLeft: "auto" }}
                  onClick={() => setOpenDrawer(!openDrawer)}
                >
                  <MenuIcon color="black" />
                </IconButton>
                <Drawer
                  anchor="left"
                  open={openDrawer}
                  onClose={() => setOpenDrawer(false)}
                  >
                  <List sx={{width:'200px',textDecoration: 'none'}}>
                  <ListItemButton sx={{padding:'20px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd',fontWeight:'bold'}}}>
                    <NavLink to='/' style={{ textDecoration: 'none' }}><ListItemText >Home</ListItemText></NavLink>
                  </ListItemButton>
                    <ListItemButton sx={{padding:'20px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/products' style={{ textDecoration: 'none' }}><ListItemText >Products</ListItemText></NavLink>
                    </ListItemButton>
                    <ListItemButton sx={{padding:'20px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/cart' style={{ textDecoration: 'none' }}><ListItemText>Cart</ListItemText></NavLink>
                    </ListItemButton>
                    <ListItemButton sx={{padding:'20px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/about' style={{ textDecoration: 'none' }}><ListItemText>About</ListItemText></NavLink>
                    </ListItemButton>
                    <ListItemButton sx={{padding:'20px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/contact' style={{ textDecoration: 'none' }}><ListItemText>Contact</ListItemText></NavLink>
                    </ListItemButton>
                  </List>
                </Drawer>
              </>
            ) : (
              <>
                <Tabs
                  sx={{ marginLeft: "auto" }}
                  value={value}
                  onChange={(e, value) => setValue(value)}
                >
                  <NavLink to='/'><Tab sx={{color:"#6b3bc4","&:hover":{fontWeight:'bold'}}} label="Home" /></NavLink>
                  <NavLink to='/products'><Tab sx={{color:"#6b3bc4","&:hover":{fontWeight:'bold'}}} label="Products" /></NavLink>
                  <NavLink to='/cart'><Tab sx={{color:"#6b3bc4","&:hover":{fontWeight:'bold'}}} label="Cart" /></NavLink>
                  <NavLink to='/about'><Tab sx={{color:"#6b3bc4","&:hover":{fontWeight:'bold'}}} label="About" /></NavLink>
                  <NavLink to='/contact'><Tab sx={{color:"#6b3bc4","&:hover":{fontWeight:'bold'}}} label="Contact" /></NavLink>
                </Tabs>
                <Button
                  sx={{
                    marginLeft: "auto",
                    backgroundColor: "#6b3bc4",
                    color: "white",
                    "&:hover": { backgroundColor: "#5931a3" },
                  }}
                  variant="contained"
                >
                  Login
                </Button>
              </>
            )}
          </Toolbar>
        </Container>
      </AppBar>
    </React.Fragment>
  );
};

export default Navbar;
